create table voiture_vente (
	id_voiture INT primary key identity,
	marque  VARCHAR(50)NOT NULL,
	modele VARCHAR(50)NOT NULL,
	annee VARCHAR(4) CHECK (annee like '[1-9][0-9][0-9][0-9]') NOT NULL,
	chevaux_vapeur  INT,
	couleur  VARCHAR(50),
	NIV VARCHAR(50),
	numero_portes  INT,
	sieges_en_cuir BIT,
	demarrage_a_distance BIT,
	toit_ouvrant BIT
);
